import React, { useState } from "react";

// --- NAVBAR ---
const Navbar = ({ setCurrentPage }) => (
  <nav className="bg-white text-gray-800 px-6 sm:px-12 py-4 flex justify-between items-center shadow-md sticky top-0 z-50">
    <div className="flex items-center space-x-2">
      <img
        src="https://upload.wikimedia.org/wikipedia/commons/5/55/Emblem_of_India.svg"
        alt="Emblem of India"
        className="h-8 w-8"
      />
      <h1 className="text-xl font-bold text-blue-900">Bharat Internship</h1>
    </div>
    <div className="hidden md:flex items-center space-x-6">
      <button
        onClick={() => setCurrentPage("home")}
        className="hover:text-blue-700 font-semibold transition duration-300"
      >
        Home
      </button>
      <button
        onClick={() => setCurrentPage("find")}
        className="hover:text-blue-700 font-semibold transition duration-300"
      >
        Find Internship
      </button>
      <button className="hover:text-blue-700 font-semibold transition duration-300">
        For Industries
      </button>
      <button className="bg-blue-800 hover:bg-blue-900 text-white px-4 py-2 rounded-lg font-semibold shadow-sm transition duration-300">
        Login
      </button>
    </div>
  </nav>
);

// --- HERO SECTION ---
const HeroSection = ({ setCurrentPage }) => (
  <section
    className="text-center py-32 px-6 bg-cover bg-center relative"
    style={{
      backgroundImage:
        "url('https://upload.wikimedia.org/wikipedia/commons/8/89/PMO_India_official_photo.jpg')",
    }}
  >
    <div className="absolute inset-0 bg-black bg-opacity-50"></div>
    <div className="relative z-10 max-w-3xl mx-auto">
      <h2 className="text-5xl md:text-6xl font-extrabold text-white mb-6 drop-shadow-lg">
        Bharat Internship
      </h2>
      <p className="text-xl italic text-gray-200 mb-8 drop-shadow-lg">
        "Internships are stepping stones to your future. Learn, explore, and
        discover your true potential."
      </p>
      <button
        onClick={() => setCurrentPage("find")}
        className="px-8 py-3 bg-orange-500 text-white rounded-lg text-lg font-semibold hover:bg-orange-600 shadow-lg transition transform hover:scale-105"
      >
        Find Your Dream Internship
      </button>
    </div>
  </section>
);

// --- PARTNER COMPANIES ---
const companies = [
  "https://upload.wikimedia.org/wikipedia/commons/4/44/IBM_logo.svg",
  "https://upload.wikimedia.org/wikipedia/commons/4/44/Microsoft_logo.svg",
  "https://upload.wikimedia.org/wikipedia/commons/1/1b/Deloitte_logo.svg",
  "https://upload.wikimedia.org/wikipedia/commons/0/0b/Walmart_logo.svg",
  "https://upload.wikimedia.org/wikipedia/commons/2/2f/Google_2015_logo.svg",
];

const PartnerCompanies = () => (
  <section className="py-12 bg-white">
    <h3 className="text-xl font-bold text-gray-800 mb-6 text-center">
      Our Partner Industries
    </h3>
    <div className="flex space-x-6 overflow-x-auto px-6">
      {companies.map((logo, i) => (
        <img
          key={i}
          src={logo}
          alt={`Company ${i}`}
          className="h-16 w-auto flex-shrink-0 transition transform hover:scale-110"
        />
      ))}
    </div>
  </section>
);

// --- FOOTER ---
const Footer = () => (
  <footer className="bg-blue-900 py-10 text-center text-white mt-12">
    <div className="flex flex-col items-center">
      <img
        src="https://upload.wikimedia.org/wikipedia/en/0/0f/Smart_India_Hackathon_Logo.png"
        alt="SIH Logo"
        className="w-20 mb-4 animate-bounce"
      />
      <h3 className="text-2xl font-bold">Smart India Hackathon</h3>
      <p className="mt-2 text-gray-200">
        Empowering Innovation â€¢ Driving Nation Building
      </p>
    </div>
  </footer>
);

// --- HOME PAGE ---
const HomePage = ({ setCurrentPage }) => (
  <div className="flex flex-col min-h-screen">
    <HeroSection setCurrentPage={setCurrentPage} />
    <PartnerCompanies />
    <Footer />
  </div>
);

// --- MAIN APP ---
function App() {
  const [currentPage, setCurrentPage] = useState("home");

  return (
    <div className="bg-white">
      <Navbar setCurrentPage={setCurrentPage} />
      {currentPage === "home" && <HomePage setCurrentPage={setCurrentPage} />}
      {currentPage === "find" && (
        <div className="text-center py-20 text-gray-800">
          {/* Placeholder for MatchEngine page */}
          <h2 className="text-3xl font-bold mb-4">MatchEngine Page</h2>
          <p>Your AI-powered internship matches will appear here.</p>
        </div>
      )}
    </div>
  );
}

export default App;
